import { makeStyles } from '@material-ui/core/styles';

const IndexStyle = makeStyles((theme) => ({
    grow: {
        flexGrow: 1,
        marginLeft: theme.spacing(0),
        marginRight: theme.spacing(0)
      },
}));

export default IndexStyle;
